import React from 'react';

function Accomodation() {
  return (
    <div className="container_center">
      <h1>1. Mia Resort</h1>
      <h1>2. Fusion Cam Ranh </h1>
      <h1>3. The Anam </h1> 
      <h1>4. Alma Resort </h1> 
      <h1>5. Intercontinental Nha Trang</h1>

    </div>
  );
}

export default Accomodation;
